const getCuentas = function (total) {


    let cuentas = [];
    const cortes = [1, 5, 9, 12, 16, 20, 23, 26];
    const codigoPlanes = ["H1H", "IEE", "H3J"];
    const estados = [
        {
            "tipo": 'AAA',
            "mensaje": "Activo"
        }, {
            "tipo": 'SAA',
            "mensaje": "Suspendido por pago"
        }, {
            "tipo": "SSA",
            "mensaje": "Suspendido parcial"
        }
    ];


    for (let i = 0; i < total; i++) {
        const numeroCuenta = "" + (Math.floor(Math.random() * 99999999) + 10000000) + "";
        const totalPrepago = Math.floor(Math.random() * 30);
        const totalPospago = Math.floor(Math.random() * 30);
        const corte = cortes[Math.floor(Math.random() * 7)];

        const email = Math.random() > 0.7 ? '' : randomEmail();
        const direccion = email === '' ? randomAddress() : (Math.random() > 0.5 ? randomAddress() : '');



        const cuenta = {
            "numero": numeroCuenta,
            "total_prepago": totalPospago,
            "total_postpago": totalPrepago,
            "corte": corte,
            "facturacion": {
                "email": email,
                "direccion": direccion
            },
            "lineas_postpago": shuffle(lineas).slice(0, totalPospago).map((linea) => {
                const planId = codigoPlanes[Math.floor(Math.random() * 2)];
                const plan = planes[planId];
                const consumoMinutos = Math.floor(Math.random() * plan.minutos);
                const consumoSMS = Math.floor(Math.random() * plan.sms)
                const consumoDatos = Math.floor(Math.random() * plan.datos.capacidad);
                const estado = Math.floor(Math.random() * 2);
                const clausula = Math.random() > 0.5 ? '' : randomDate(new Date(), new Date(2020,12,31));

                const lineaOb = {
                    "tipo": "postpago",
                    "numero": linea,
                    "cuenta": numeroCuenta,
                    "plan": plan,
                    "estado": estado,
                    "clausula": clausula,
                    "consumos": {
                        "datos": consumoDatos,
                        "sms": consumoSMS,
                        "minutos": consumoMinutos
                    }
                }

                return lineaOb;

            }),
            "lineas_prepago": shuffle(lineas).slice(0, totalPrepago).map((linea) => {
                const planId = codigoPlanes[Math.floor(Math.random() * 2)];
                const plan = planes[planId];
                const consumoMinutos = Math.floor(Math.random() * plan.minutos);
                const consumoSMS = Math.floor(Math.random() * plan.sms)
                const consumoDatos = Math.floor(Math.random() * plan.datos.capacidad);
                const estado = Math.floor(Math.random() * 2);
                const clausula = Math.random() > 0.5 ? '' : randomDate(new Date(), new Date(2020,12,31));

                const lineaOb = {
                    "tipo": "prepago",
                    "numero": linea,
                    "cuenta": numeroCuenta,
                    "plan": plan,
                    "estado": estado,
                    "clausula": clausula,
                    "consumos": {
                        "datos": consumoDatos,
                        "sms": consumoSMS,
                        "minutos": consumoMinutos
                    }
                }


                return lineaOb;

            })
        };

        cuentas.push(cuenta);
    }



    return cuentas;
};

